import React, { Component } from 'react';
import { getUser } from '../services/userAPI';

class Header extends Component {
    loggedUser = async () => {
      const user = await getUser();
      const { name } = user;
      console.log(name);
      const result = (
        <h3>{name}</h3>
      );
      return result;
    }

    render() {
      return (
        <header data-testid="header-component">
          {this.loggedUser()}
        </header>
      );
    }
}

export default Header;
